import React from "react";

const AdminPanel = () => {
  return (
    <div className="loginPage">
      <div className="loginHeader">
        <h2>Bienvenido, {JSON.parse(localStorage.getItem("user")).userName}</h2>
      </div>
    </div>
  );
};

export default AdminPanel;
